import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div id="home">
      	<img src="LeersLogo.png" alt="logo" />
      	<h1>Work in Progress</h1>
      </div>
    </div>
  );
}

export default App;
